INSERT INTO `content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_position`, `field_shortBio`, `field_fullBio`, `field_synopsis`, `field_references`, `field_client`, `field_conclusion`, `field_video`, `field_gallery`, `field_introSubheading`, `field_intro`, `field_capabilitiesHeading`, `field_capabilitiesSubheading`, `field_capabilitiesIntro`, `field_capabilitiesList`, `field_processHeading`, `field_processSubheading`, `field_processIntro`, `field_processFigure`, `field_discoverHeading`, `field_discoverSubheading`, `field_discoverIntro`, `field_discoverList`, `field_designHeading`, `field_designSubheading`, `field_designIntro`, `field_designList`, `field_measureHeading`, `field_measureSubheading`, `field_measureIntro`, `field_measureList`, `field_clientsHeading`, `field_clientsSubheading`, `field_clientsIntro`, `field_clientsList`, `field_teamHeading`, `field_teamSubheading`, `field_teamIntro`, `field_addressLine1`, `field_phone`, `field_addressLine2`, `field_articleBlockSize`, `field_articleBackgroundColor`, `field_isFeatured`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('6', '5', 'en_us', 'About Us', 'We make sh*t happen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '<p>My money\'s in that office, right? If she start giving me some bullshit about it ain\'t there, and we got to go someplace else and get it, I\'m gonna shoot you in the head then and there. Then I\'m gonna shoot that bitch in the kneecaps, find out where my goddamn money is.</p>', 'Our Capabilities', '', '<p>Normally, both your asses would be dead as fucking fried chicken, but you happened to pull this shit while I\'m in a transitional period so I don\'t wanna kill you, I wanna help you. But I can\'t give you this case, it don\'t belong to me. Besides, I\'ve already been through too much shit this morning over this case to hand it over to your dumb ass.</p>', '<ul>\r\n	\r\n<li class=\"strategy xd\">Strategy</li>	\r\n<li class=\"videography xd\">Video Production</li>	\r\n<li class=\"photography xd\">Photography</li>	\r\n<li class=\"mobile xd\">Mobile Development</li>	\r\n<li class=\"ui xd\">UI Design</li>	\r\n<li class=\"web xd\">Web Development</li>	\r\n<li class=\"web xd\">Data Visualization</li>	\r\n<li class=\"ux xd\">UX Design</li>	\r\n<li class=\"research xd\">Research</li>	\r\n<li class=\"ia xd\">Info Architecture</li>	\r\n<li class=\"enterprise xd\">Enterprise</li>	\r\n<li class=\"retail id\">Retail Design</li>	\r\n<li class=\"rapid xd\">Rapid Prototyping</li>	\r\n<li class=\"model id\">Model Making</li>	\r\n<li class=\"brainstorming xd-id\">Brainstorming</li>	\r\n<li class=\"application xd\">Application Development</li>	\r\n<li class=\"product id\">Product Engineering</li>	\r\n<li class=\"industrial id\">Industrial Design</li></ul>', 'Our Process', '', '<p>Now that we know who you are, I know who I am. I\'m not a mistake! It all makes sense! In a comic, you know how you can tell who the arch-villain\'s going to be? He\'s the exact opposite of the hero. And most times they\'re friends, like you and me! I should\'ve known way back when... You know why, David? Because of the kids. They called me Mr Glass.</p>', '<figure>\r\n<img src=\"http://lorempixel.com/g/320/240/animals\"><figcaption>FIGURE CAPTION</figcaption></figure>', 'Discover & Define', 'You can\'t solve a puzzle without the correct pieces.', '<p>Do you see any Teletubbies in here? Do you see a slender plastic tag clipped to my shirt with my name printed on it? Do you see a little Asian child with a blank expression on his face sitting outside on a mechanical helicopter that shakes when you put quarters in it? No? Well, that\'s what you see at a toy store. And you must think you\'re in a toy store, because you\'re here shopping for an infant named Jeb.</p>', '<ul>\r\n	<li>Strategy</li>\r\n	<li>Research</li>\r\n	<li>Communication &amp; Collaboration</li>\r\n	<li>UX Design</li>\r\n	<li>Info Architecture</li>\r\n	<li>Brainstorming</li>\r\n	<li>Rapid Prototyping</li>\r\n	<li>Model Making</li>\r\n</ul>', 'Design & Development', 'Your face needs design and development!', '<p>Your bones don\'t break, mine do. That\'s clear. Your cells react to bacteria and viruses differently than mine. You don\'t get sick, I do. That\'s also clear. But for some reason, you and I react the exact same way to water. We swallow it too fast, we choke. We get some in our lungs, we drown. However unreal it may seem, we are connected, you and I. We\'re on the same curve, just on opposite ends.</p>', '<ul>\r\n	<li>UI Design</li>	<li>Web Development</li>	<li>Data Visualization</li>	<li>Application Development</li>	<li>Rapid Prototyping</li>	<li>Retail Design</li>	<li>Industrial Design</li>	<li>Product Engineering</li></ul>', 'Measure & Improve', '', '<p>Well, the way they make shows is, they make one show. That show\'s called a pilot. Then they show that show to the people who make shows, and on the strength of that one show they decide if they\'re going to make more shows. Some pilots get picked and become television programs. Some don\'t, become nothing. She starred in one of the ones that became nothing.</p>', '<ul><li>Details Here</li></ul>', 'Our Clients', '', '<p>Now that there is the Tec-9, a crappy spray gun from South Miami. This gun is advertised as the most popular gun in American crime. Do you believe that shit? It actually says that in the little book that comes with it: the most popular gun in American crime. Like they\'re actually proud of that shit.</p>', '<ul><li>Boeing</li><li>UL</li><li>JWT</li><li>Acquity Group</li><li>AKQA</li><li>NOAA</li><li>Expedia</li><li>US DOS</li><li>Nordstrom</li><li>Celebrity Cruises</li></ul>', 'Our Team', '', '<p>The path of the righteous man is beset on all sides by the iniquities of the selfish and the tyranny of evil men. Blessed is he who, in the name of charity and good will, shepherds the weak through the valley of darkness, for he is truly his brother\'s keeper and the finder of lost children. And I will strike down upon thee with great vengeance and furious anger those who would attempt to poison and destroy My brothers. And you will know My name is the Lord when I lay My vengeance upon thee.</p>', NULL, NULL, NULL, NULL, NULL, '0', '2014-08-13 16:36:09', '2014-09-16 22:12:14', 'd8e5f8ca-d71c-4745-a257-2cf3f7db9f16');
