INSERT INTO `entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('15', '5', '5', '1', 'en_us', '3', '', '{\"typeId\":\"5\",\"authorId\":null,\"title\":\"About Us\",\"slug\":\"about\",\"postDate\":1409256463,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"27\":\"Our Capabilities\",\"29\":\"<p>Normally, both your asses would be dead as fucking fried chicken, but you happened to pull this shit while I\'m in a transitional period so I don\'t wanna kill you, I wanna help you. But I can\'t give you this case, it don\'t belong to me. Besides, I\'ve already been through too much shit this morning over this case to hand it over to your dumb ass.<\\/p>\",\"30\":\"<ul>\\r\\n\\t\\r\\n<li class=\\\"strategy xd\\\">Strategy<\\/li>\\t\\r\\n<li class=\\\"videography xd\\\">Video Production<\\/li>\\t\\r\\n<li class=\\\"photography xd\\\">Photography<\\/li>\\t\\r\\n<li class=\\\"mobile xd\\\">Mobile Development<\\/li>\\t\\r\\n<li class=\\\"ui xd\\\">UI Design<\\/li>\\t\\r\\n<li class=\\\"web xd\\\">Web Development<\\/li>\\t\\r\\n<li class=\\\"web xd\\\">Data Visualization<\\/li>\\t\\r\\n<li class=\\\"ux xd\\\">UX Design<\\/li>\\t\\r\\n<li class=\\\"research xd\\\">Research<\\/li>\\t\\r\\n<li class=\\\"ia xd\\\">Info Architecture<\\/li>\\t\\r\\n<li class=\\\"enterprise xd\\\">Enterprise<\\/li>\\t\\r\\n<li class=\\\"retail id\\\">Retail Design<\\/li>\\t\\r\\n<li class=\\\"rapid xd\\\">Rapid Prototyping<\\/li>\\t\\r\\n<li class=\\\"model id\\\">Model Making<\\/li>\\t\\r\\n<li class=\\\"brainstorming xd-id\\\">Brainstorming<\\/li>\\t\\r\\n<li class=\\\"application xd\\\">Application Development<\\/li>\\t\\r\\n<li class=\\\"product id\\\">Product Engineering<\\/li>\\t\\r\\n<li class=\\\"industrial id\\\">Industrial Design<\\/li><\\/ul>\",\"28\":\"\",\"50\":\"Our Clients\",\"52\":\"<p>Now that there is the Tec-9, a crappy spray gun from South Miami. This gun is advertised as the most popular gun in American crime. Do you believe that shit? It actually says that in the little book that comes with it: the most popular gun in American crime. Like they\'re actually proud of that shit.<\\/p>\",\"53\":\"<ul><li>Boeing<\\/li><li>UL<\\/li><li>JWT<\\/li><li>Acquity Group<\\/li><li>AKQA<\\/li><li>NOAA<\\/li><li>Expedia<\\/li><li>US DOS<\\/li><li>Nordstrom<\\/li><li>Celebrity Cruises<\\/li><\\/ul>\",\"51\":\"\",\"40\":\"Design & Development\",\"43\":\"<p>Your bones don\'t break, mine do. That\'s clear. Your cells react to bacteria and viruses differently than mine. You don\'t get sick, I do. That\'s also clear. But for some reason, you and I react the exact same way to water. We swallow it too fast, we choke. We get some in our lungs, we drown. However unreal it may seem, we are connected, you and I. We\'re on the same curve, just on opposite ends.<\\/p>\",\"44\":\"<ul>\\r\\n\\t<li>UI Design<\\/li>\\t<li>Web Development<\\/li>\\t<li>Data Visualization<\\/li>\\t<li>Application Development<\\/li>\\t<li>Rapid Prototyping<\\/li>\\t<li>Retail Design<\\/li>\\t<li>Industrial Design<\\/li>\\t<li>Product Engineering<\\/li><\\/ul>\",\"42\":\"\",\"41\":\"Your face needs design and development!\",\"36\":\"Discover & Define\",\"38\":\"<p>Do you see any Teletubbies in here? Do you see a slender plastic tag clipped to my shirt with my name printed on it? Do you see a little Asian child with a blank expression on his face sitting outside on a mechanical helicopter that shakes when you put quarters in it? No? Well, that\'s what you see at a toy store. And you must think you\'re in a toy store, because you\'re here shopping for an infant named Jeb.<\\/p>\",\"39\":\"<ul>\\r\\n\\t<li>Strategy<\\/li>\\r\\n\\t<li>Research<\\/li>\\r\\n\\t<li>Communication &amp; Collaboration<\\/li>\\r\\n\\t<li>UX Design<\\/li>\\r\\n\\t<li>Info Architecture<\\/li>\\r\\n\\t<li>Brainstorming<\\/li>\\r\\n\\t<li>Rapid Prototyping<\\/li>\\r\\n\\t<li>Model Making<\\/li>\\r\\n<\\/ul>\",\"35\":\"\",\"37\":\"You can\'t solve a puzzle without the correct pieces.\",\"1\":\"We make sh*t happen.\",\"26\":\"<p>My money\'s in that office, right? If she start giving me some bullshit about it ain\'t there, and we got to go someplace else and get it, I\'m gonna shoot you in the head then and there. Then I\'m gonna shoot that bitch in the kneecaps, find out where my goddamn money is.<\\/p>\",\"24\":\"\",\"25\":\"\",\"45\":\"Measure & Improve\",\"48\":\"<p>Well, the way they make shows is, they make one show. That show\'s called a pilot. Then they show that show to the people who make shows, and on the strength of that one show they decide if they\'re going to make more shows. Some pilots get picked and become television programs. Some don\'t, become nothing. She starred in one of the ones that became nothing.<\\/p>\",\"49\":\"<ul><li>Details Here<\\/li><\\/ul>\",\"47\":\"\",\"46\":\"\",\"34\":\"<figure>\\r\\n<img src=\\\"http:\\/\\/lorempixel.com\\/g\\/320\\/240\\/animals\\\"><figcaption>FIGURE CAPTION<\\/figcaption><\\/figure>\",\"31\":\"Our Process\",\"33\":\"<p>Now that we know who you are, I know who I am. I\'m not a mistake! It all makes sense! In a comic, you know how you can tell who the arch-villain\'s going to be? He\'s the exact opposite of the hero. And most times they\'re friends, like you and me! I should\'ve known way back when... You know why, David? Because of the kids. They called me Mr Glass.<\\/p>\",\"32\":\"\",\"54\":\"Our Team\",\"56\":\"<p>The path of the righteous man is beset on all sides by the iniquities of the selfish and the tyranny of evil men. Blessed is he who, in the name of charity and good will, shepherds the weak through the valley of darkness, for he is truly his brother\'s keeper and the finder of lost children. And I will strike down upon thee with great vengeance and furious anger those who would attempt to poison and destroy My brothers. And you will know My name is the Lord when I lay My vengeance upon thee.<\\/p>\",\"55\":\"\"}}', '2014-09-16 22:12:15', '2014-09-16 22:12:15', 'c0660765-547c-40ba-b2ee-59ca7d42e77b');
